    type: String,
    unique: true,
    required: true,
    minlength: 6,
    maxlength: 20,
  },
  password: {
    type: String,
    required: true
  },
  nickname: {
    type: String,
    minlength: 2,
    maxlength: 12
  },
  email: {
    type: String,
    required: true
  },
  createdAt: { type: Date, default: Date.now },
  updqtedAt: { type: Date, default: Date.now },
  lastLogin: { type: Date, default: Date.now },
